	int Tower::miniAt(int xP, int yP, int yOff)
	{
		yP = yP * 8;
		yP += yOff;
		yOff = yP % 8;
		yP = (yP - yOff) / 8;

		while (yP < 0) yP += 100;
		while (yP >= 100) yP -= 100;
		if (xP >= 0 && xP < 40)
		{
			return miniTower[xP + vmult[yP]];
		}
		else if (xP == -1)
		{
			return miniTower[vmult[yP]];
		}
		else if (xP == 40)
		{
			return miniTower[39 + vmult[yP]];
		}
		return 0;
	}

	void Tower::fillBackground(std::vector<std::string>& tmap)
	{
		for (int j = 0; j < 120; j++)
		{
			std::vector<std::string> mapRow = vvvvvv::Utility::split(tmap[j], ',');
			for (int i = 0; i < 40; i++)
			{
				back[i + vmult[j]] = atoi(mapRow[i].c_str());
			}
		}
	}

	void Tower::fillMiniTower(std::vector<std::string>& tmap)
	{
		for (int j = 0; j < 100; j++)
		{
			std::vector<std::string> mapRow = vvvvvv::Utility::split(tmap[j], ',');
			for (int i = 0; i < 40; i++)
			{
				miniTower[i + vmult[j]] = atoi(mapRow[i].c_str());
			}
		}
	}

