	void Tower::fillContents(std::vector<std::string>& tmap)
	{
		for (int j = 0; j < 700; j++)
		{
			std::vector<std::string> mapRow = vvvvvv::Utility::split(tmap[j], ',');

			for (int i = 0; i < 40; i++)
			{
				contents[i + vmult[j]] = atoi(mapRow[i].c_str());
			}
		}
	}

